from twoSumII.main import Solution


class TestTwoSum:
    value = 0

    def test_one(self):
        so = Solution()
        self.value = so.twoSum(numbers=[2, 7, 11, 15], target=9)
        assert self.value == [1, 2]

    def test_two(self):
        so = Solution()
        self.value = so.twoSum(numbers=[2, 3, 4], target=6)
        assert self.value == [1, 3]

    def test_three(self):
        so = Solution()
        self.value = so.twoSum(numbers=[-1, 0], target=-1)
        assert self.value == [1, 2]

